def get_configured_hdfs_client():
    """
    This is a helper that fetches the configuration value for 'client' in
    the [hdfs] section. It will return the client that retains backwards
    compatibility when 'client' isn't configured.
    """
    config = luigi.configuration.get_config()
    if config.has_section('hdfs'):
        client = config.get('hdfs', 'client')
        if client == 'hadoopcli':
            return HadoopClient()
        elif client == 'hadoop-hdfs':
            return HadoopHdfsClient()
        else:
            raise ValueError('Unknown client: {}'.format(client))
    else:
        return HadoopClient()
